import React from 'react';
import './User.css';
import {Navbar, Container} from 'react-bootstrap';
import logo from '../../evolutelogo.png';


function User() {
    return (
        <div>
            <Navbar bg="dark">
                <Container>
                    <Navbar.Brand href="#home">
                    <img
                        src={logo}
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                        alt="evolutelogo"
                    />
                    </Navbar.Brand>
                </Container>
            </Navbar> 
        </div>
    )
}

export default User
